INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お父さん\nリラックスし過ぎると\n成仏しちゃうよ？", 1, 1, 3, 0, 0, 103102, 4, 1195);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("快適です…\n幽霊もどんどん\n集まってきますね…", 1, 1, 3, 0, 0, 103102, 5, 1196);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("はぁはぁ…\nお、お父さん、\n代わりに運動して…", 1, 1, 3, 0, 0, 103102, 6, 1197);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お父さんの分も、\n私が食べるね", 1, 1, 3, 0, 0, 103102, 7, 1198);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この本の占い\n私の占いと違う…", 1, 1, 3, 0, 0, 103102, 8, 1199);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私だって、一人で\n買い物ぐらい\nできますわ…きっと", 1, 1, 1, 0, 0, 103201, 1, 1201);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("そろそろ新しい\n案件を始めないと\nいけませんわね", 1, 1, 1, 0, 0, 103201, 2, 1202);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("一日も早く、\n一人前の商人に\nなりたいものです", 1, 1, 1, 0, 0, 103201, 3, 1203);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("平和を買うのには\nどれほどのお金が\n必要なのかしら？", 1, 1, 1, 0, 0, 103201, 4, 1204);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ここももう少し広いと\n落ち着くのですけど。\n改築しませんこと？", 1, 1, 1, 0, 0, 103201, 5, 1205);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あの方はお金で雇った\nわけではないのに\n私といてくださる…", 4, 1, 1, 0, 0, 103201, 101, 1206);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 8, 1, 1, 0, 0, 103201, 102, 1207);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私と、庶民向けの\nお店へ一緒に\n参りませんか？", 1, 1, 2, 0, 0, 103201, 1, 1208);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("資産運用？\nお幾らほど\n増やしたいのです？", 1, 1, 2, 0, 0, 103201, 2, 1209);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("どんぶり勘定だとよく\n言われるのですが…\n例えが小さすぎます！", 1, 1, 2, 0, 0, 103201, 3, 1210);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お金で解決するのは\n悪いことでは\nありませんわよね？", 1, 1, 2, 0, 0, 103201, 4, 1211);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("その、よろしければ\n私とお散歩など\nいかがです？", 4, 1, 2, 0, 0, 103201, 101, 1212);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もしあなたさまが\n道に迷われるなら、\n私もお供いたします！", 8, 1, 2, 0, 0, 103201, 102, 1213);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("早起きは三ルピの徳と\n申しますが…\nもっとお得ですわね", 1, 1, 2, 0, 1, 103201, 1, 1214);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1, 1, 2, 0, 2, 103201, 2, 1215);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1, 1, 2, 0, 3, 103201, 3, 1216);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("だらしない身なりでは\n取引相手に信用して\nいただけませんものね", 1, 1, 3, 0, 0, 103201, 1, 1217);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この感触と安らぎ…\n素晴らしい\n費用対効果ですわ…", 1, 1, 3, 0, 0, 103201, 2, 1218);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1, 1, 3, 0, 0, 103201, 3, 1219);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("目に見えないものに\nお金をかけるのが\n真の贅沢ですわ！", 1, 1, 3, 0, 0, 103201, 4, 1220);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1, 1, 3, 0, 0, 103201, 5, 1221);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("健康はお金では\n買えませんが\n運動器具は別ですわ！", 1, 1, 3, 0, 0, 103201, 6, 1222);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("なかなか\n美味ですわ\nシェフはどちらに？", 1, 1, 3, 0, 0, 103201, 7, 1223);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("経済の仕組みを\nしっかりと\n学ばなくては…", 1, 1, 3, 0, 0, 103201, 8, 1224);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("そろそろ新しい\n案件を始めないと\nいけませんわね", 1, 1, 1, 0, 0, 103202, 1, 1226);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ええと、これは\nおいくらで買ったん\nでしたっけ？", 1, 1, 1, 0, 0, 103202, 2, 1227);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お金を見せたら\n態度が変わる人は\n信用できませんわ", 1, 1, 1, 0, 0, 103202, 3, 1228);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("地図が読めずとも\n道に迷わない方って\nいらっしゃるのですね", 1, 1, 1, 0, 0, 103202, 4, 1229);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この狭さも\n慣れれば\n快適ですわ♪", 1, 1, 1, 0, 0, 103202, 5, 1230);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あの方はお金で雇った\nわけではないのに\n私といてくださる…", 8, 1, 1, 0, 0, 103202, 101, 1231);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("たとえ私が間違っても\nきっとあの方が\n正してくれますわ…", 8, 1, 1, 0, 0, 103202, 102, 1232);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("一人前の商人に\n相応しい居振る舞いを\nしたいものですわ", 1, 1, 2, 0, 0, 103202, 1, 1233);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("幼い頃\nお店屋さんごっこを\nなさいましたか？", 1, 1, 2, 0, 0, 103202, 2, 1234);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("資産運用？\nお幾らほど\n増やしたいのです？", 1, 1, 2, 0, 0, 103202, 3, 1235);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("今度一緒に…\nパーティにでも\n行きませんこと？", 1, 1, 2, 0, 0, 103202, 4, 1236);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("その、よろしければ\n私とお散歩など\nいかがです？", 8, 1, 2, 0, 0, 103202, 101, 1237);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あなたさまの優しさは\nお金には\n代えられませんわね", 8, 1, 2, 0, 0, 103202, 102, 1238);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("なぜだか\n眠り足りないような\n感じがしますわ…", 1, 1, 2, 0, 1, 103202, 1, 1239);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("昼食は町の屋台で\n立ったまま食べて\nみたいですわ！", 1, 1, 2, 0, 2, 103202, 2, 1240);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("よろしければ\nお休み前のミルクを\n御一緒にいかが？", 1, 1, 2, 0, 3, 103202, 3, 1241);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ドレスは汚れていない\nようですが…やだ\n髪がほつれてますわ！", 1, 1, 3, 0, 0, 103202, 1, 1242);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("こういったものに\n腰を沈めると…\nき、気が緩んで…", 1, 1, 3, 0, 0, 103202, 2, 1243);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("何の見返りも求めず\nただひたすら愛でて\nいたいのです！", 1, 1, 3, 0, 0, 103202, 3, 1244);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("香りは質のいいものと\nそうでないものが\nはっきり分かりますわ", 1, 1, 3, 0, 0, 103202, 4, 1245);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("誰ひとり寒い思いを\nしない町にするために\n私にできる事は…", 1, 1, 3, 0, 0, 103202, 5, 1246);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("目標は遠くに\n置いた方が励みに\nなりますわ！", 1, 1, 3, 0, 0, 103202, 6, 1247);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("なかなか\n美味ですわ\nシェフはどちらに？", 1, 1, 3, 0, 0, 103202, 7, 1248);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("商人って、物語では\n悪役にされやすいの\nですね…", 1, 1, 3, 0, 0, 103202, 8, 1249);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("家の中のものを使って\n物ボケ、考えるべ！", 1, 1, 1, 0, 0, 103301, 1, 1251);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("毎日の日課…それは\n炊事、洗濯、大喜利\nだべ！", 1, 1, 1, 0, 0, 103301, 2, 1252);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うちに塀ができたら、\nへー、って言いたい！", 1, 1, 1, 0, 0, 103301, 3, 1253);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("オラが作る料理は\nこの後スタッフで\n美味しくいただくべよ", 1, 1, 1, 0, 0, 103301, 4, 1254);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("エリザベスも\n連れてきてぇ～", 1, 1, 1, 0, 0, 103301, 5, 1255);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あんちゃんも、\nエリザベスと同じ位\nめんこいべ♪", 4, 1, 1, 0, 0, 103301, 101, 1256);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("オラとあんちゃん、\n息がぴったりに\nなってきたべ…！", 8, 1, 1, 0, 0, 103301, 102, 1257);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おぉ！　そんな急に\nツッコまれたら、\nびっくらこくべやー！", 1, 1, 2, 0, 0, 103301, 1, 1258);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ネタはオラが書くけど\nあんちゃんが\n書きたかったら\n書いてもいいんだぞ？", 1, 1, 2, 0, 0, 103301, 2, 1259);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1, 1, 2, 0, 0, 103301, 3, 1260);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("押すなよ、\n絶対押すなよ\n…なんて\n言ってないべさ？", 1, 1, 2, 0, 0, 103301, 4, 1261);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 4, 1, 2, 0, 0, 103301, 101, 1262);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("将来的には夫婦漫才\nってのも…あ、ひ、\nひとりごとだべさ～！", 8, 1, 2, 0, 0, 103301, 102, 1263);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おはよう！　一緒に\n牛の乳しぼりいくべ？", 1, 1, 2, 0, 1, 103301, 1, 1264);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お昼だ～腹が減っては\n笑いはできぬ～！", 1, 1, 2, 0, 2, 103301, 2, 1265);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("今日もよく働いたべ！\nさ、今からは\nお笑いの練習だ～！", 1, 1, 2, 0, 3, 103301, 3, 1266);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("舞台に上がる前に\n身なりは整えねぇと\nだめだべ～！", 1, 1, 3, 0, 0, 103301, 1, 1267);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ナイスなイスに\n座りたい、\nなんちゃって！", 1, 1, 3, 0, 0, 103301, 2, 1268);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("めんこいのは、\nスベっても許される\nからずるいべな～？", 1, 1, 3, 0, 0, 103301, 3, 1269);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("必要以上に\n癒されちまうべや～", 1, 1, 3, 0, 0, 103301, 4, 1270);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ぽかぽかだ…\nウケた会場みてぇだ", 1, 1, 3, 0, 0, 103301, 5, 1271);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お笑い芸人は、\n体が資本だべさ～！", 1, 1, 3, 0, 0, 103301, 6, 1272);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1, 1, 3, 0, 0, 103301, 7, 1273);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ネタ作りのヒントが\n載ってねぇか探すべ", 1, 1, 3, 0, 0, 103301, 8, 1274);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("さぁ今日も張り切って\n漫才の練習するべさ！", 1, 1, 1, 0, 0, 103302, 1, 1276);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この部屋でも、商品\n売っていいんだべか？", 1, 1, 1, 0, 0, 103302, 2, 1277);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("眼鏡を頭の上に乗せて\n「メガネメガネ～」\nって言う練習した方が\nいいべか？", 1, 1, 1, 0, 0, 103302, 3, 1278);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("漫才を持ち時間に\n収めるには、何度も\n練習するしかねぇべ", 1, 1, 1, 0, 0, 103302, 4, 1279);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("エリザベスも\n連れてきてぇ～", 1, 1, 1, 0, 0, 103302, 5, 1280);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うう…あんちゃんに\nツッコまれたくて\nうずうずしてきたべ～", 8, 1, 1, 0, 0, 103302, 101, 1281);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あんちゃんに\n採れたての食材を\n食わしてやりてぇ～", 8, 1, 1, 0, 0, 103302, 102, 1282);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("押すなよ\n絶対押すなよ\n…なんて\n言ってないべさ？", 1, 1, 2, 0, 0, 103302, 1, 1283);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あんちゃん、百連\nツッコミ特訓だ～！", 1, 1, 2, 0, 0, 103302, 2, 1284);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あんちゃん、オラには\n容赦なんかせずに\nツッコんでくれて\nいいから！", 1, 1, 2, 0, 0, 103302, 3, 1285);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("「なんでだべ～！」\nって言いながら\nツッコむといいべ！", 1, 1, 2, 0, 0, 103302, 4, 1286);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あはは～あんちゃんの\nツッコミはやっぱり\n気持ちいいなぁ～", 8, 1, 2, 0, 0, 103302, 101, 1287);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("将来的には夫婦漫才\nってのも…あ、ひ\nひとりごとだべさ～！", 8, 1, 2, 0, 0, 103302, 102, 1288);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おはよう！\n今日もいい\nネタ作り日和だ！", 1, 1, 2, 0, 1, 103302, 1, 1289);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お昼だな\nご飯を食べたら、\nネタの練習するべ！", 1, 1, 2, 0, 2, 103302, 2, 1290);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もうこんな時間だべ\nネタ作りは\n明日にするべ…", 1, 1, 2, 0, 3, 103302, 3, 1291);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うーん…衣装、\nずれてねぇべか？", 1, 1, 3, 0, 0, 103302, 1, 1292);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ナイスなイスに\n座りたい\nなんちゃって！", 1, 1, 3, 0, 0, 103302, 2, 1293);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("はう～\nなまらめんこいべや～", 1, 1, 3, 0, 0, 103302, 3, 1294);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("必要以上に\n癒されちまうべや～", 1, 1, 3, 0, 0, 103302, 4, 1295);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("笑いをとることを\n忘れるほど\nあったけぇべ～", 1, 1, 3, 0, 0, 103302, 5, 1296);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("たくさん運動して\n動きでも笑いがとれる\nように頑張るべ～！", 1, 1, 3, 0, 0, 103302, 6, 1297);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もぐもぐ…\nボケることも\n忘れちまう美味さだ～", 1, 1, 3, 0, 0, 103302, 7, 1298);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("幅広く教養を\n身につけて\nいいネタ作るべ！", 1, 1, 3, 0, 0, 103302, 8, 1299);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("通りにいる\nカップル…爆発\nすればいいのに…", 1, 1, 1, 0, 0, 103401, 1, 1301);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("う～ん、仕事なんて\nしないで、\n飲んでたいな～", 1, 1, 1, 0, 0, 103401, 2, 1302);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("今日は一日、\n外に出ない！\nもう決めたわ！", 1, 1, 1, 0, 0, 103401, 3, 1303);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お腹空いた…\nけど、外に出るのは\n面倒だなぁ", 1, 1, 1, 0, 0, 103401, 4, 1304);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うぅ…頭がガンガン\nする…昨日、\n飲み過ぎたかな…", 1, 1, 1, 0, 0, 103401, 5, 1305);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("デートとか…\n誘っても嫌がられ\nないかな…？", 4, 1, 1, 0, 0, 103401, 101, 1306);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もしかして運命の\n相手だったり…\nするのかな", 8, 1, 1, 0, 0, 103401, 102, 1307);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("やっぱり一杯目が\n一番おいしいわ～！\n…え、見てた！？", 1, 1, 2, 0, 0, 103401, 1, 1308);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("頼れるお姉さんだって\nところ、もっと見せて\nあげるからね", 1, 1, 2, 0, 0, 103401, 2, 1309);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ねえ、一緒に買い物に\n行かない？　その…\nの、飲み物とか…", 1, 1, 2, 0, 0, 103401, 3, 1310);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ひっく、うふふ…\nもっとお姉さんと\nお話しようよ～", 1, 1, 2, 0, 0, 103401, 4, 1311);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 4, 1, 2, 0, 0, 103401, 101, 1312);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いつか…\nキミと一緒に飲めたら\n楽しいだろうな", 8, 1, 2, 0, 0, 103401, 102, 1313);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おはよう…朝は\nちょっとつらいな…\n低血圧なのよ…", 1, 1, 2, 0, 1, 103401, 1, 1314);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おっひるー♪\nなに食べよっかな～♪", 1, 1, 2, 0, 2, 103401, 2, 1315);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ふわあ…\n眠る前にちょっと\n一杯…冗談よ", 1, 1, 2, 0, 3, 103401, 3, 1316);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うう…\n髪がボサボサ…\nちゃんとしなきゃ…", 1, 1, 3, 0, 0, 103401, 1, 1317);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1, 1, 3, 0, 0, 103401, 2, 1318);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("こういうの男の子に\nプレゼントして\nもらいたいな…", 1, 1, 3, 0, 0, 103401, 3, 1319);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うわあ、\nこれ、私の好きな\n香りだー！", 1, 1, 3, 0, 0, 103401, 4, 1320);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ぽっかぽか…\nあとは熱い一杯が\nあれば…！", 1, 1, 3, 0, 0, 103401, 5, 1321);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("家でゴロゴロして\n付いちゃったお肉を\n落とさないと…！", 1, 1, 3, 0, 0, 103401, 6, 1322);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もぐもぐ…\nおーいしー！\n…太らないよね？", 1, 1, 3, 0, 0, 103401, 7, 1323);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1, 1, 3, 0, 0, 103401, 8, 1324);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("仕事終わりの一杯の\nために、今日も\n頑張らないと", 1, 1, 1, 0, 0, 103402, 1, 1326);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("今日は\nのんびり\n過ごそうかな～", 1, 1, 1, 0, 0, 103402, 2, 1327);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あ…\nお皿、洗って\nなかった…", 1, 1, 1, 0, 0, 103402, 3, 1328);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もう少し、大人の\n魅力が出せるように\nなりたいな", 1, 1, 1, 0, 0, 103402, 4, 1329);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("素敵な彼氏…\n欲しいなぁ…", 1, 1, 1, 0, 0, 103402, 5, 1330);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("彼と私\n釣り合うかな…\n大丈夫よね？", 8, 1, 1, 0, 0, 103402, 101, 1331);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("今後のために\nちょっとは花嫁修業\nしてみようかな…？", 8, 1, 1, 0, 0, 103402, 102, 1332);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("何事も\nお姉さんと一緒に\n楽しく頑張りましょ？", 1, 1, 2, 0, 0, 103402, 1, 1333);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ね、ねえ！\nキミは年上と年下\nどっちが好きかな？", 1, 1, 2, 0, 0, 103402, 2, 1334);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もう…\n構ってくれないと\n泣いちゃうぞ～？", 1, 1, 2, 0, 0, 103402, 3, 1335);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お姉さんが～\n可愛がって\nあげようか～？", 1, 1, 2, 0, 0, 103402, 4, 1336);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("極力人付き合いは\nしない主義なんだけど\nキミは例外かも…", 8, 1, 2, 0, 0, 103402, 101, 1337);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お姉さんとチュー\nする？　ふふふ～\n冗談で～す！", 8, 1, 2, 0, 0, 103402, 102, 1338);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("さーて、今日も\nいっちょやるぞー！", 1, 1, 2, 0, 1, 103402, 1, 1339);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("後でのんびり\nストレッチでも\nしようっと♪", 1, 1, 2, 0, 2, 103402, 2, 1340);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("一日よく働いた～！\n自分にごほうび\nあげたいなー♪", 1, 1, 2, 0, 3, 103402, 3, 1341);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("仕事の前に、髪とか\n整えないと…", 1, 1, 3, 0, 0, 103402, 1, 1342);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("自然体でゴロゴロ\nするのって\n幸せだなぁ…", 1, 1, 3, 0, 0, 103402, 2, 1343);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もう大人だし…\nあんまり可愛いのは\n似合わないかな…？", 1, 1, 3, 0, 0, 103402, 3, 1344);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うわあ\nこれ、私の好きな\n香りだー！", 1, 1, 3, 0, 0, 103402, 4, 1345);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あったかーい…\nだ、だらけ\nちゃいそう…", 1, 1, 3, 0, 0, 103402, 5, 1346);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("地道な努力が\nリア充への\n第一歩！", 1, 1, 3, 0, 0, 103402, 6, 1347);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おーいしっ♪\nこのために\n生きてるわねえ", 1, 1, 3, 0, 0, 103402, 7, 1348);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("大人の女らしく\n色んなことを学んで\nおかなくっちゃ", 1, 1, 3, 0, 0, 103402, 8, 1349);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1, 1, 1, 0, 0, 103801, 1, 1351);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("き、きらーん☆\nお姉ちゃんに\n似てるかな…？", 1, 1, 1, 0, 0, 103801, 2, 1352);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1, 1, 1, 0, 0, 103801, 3, 1353);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ちょっと、休憩…\n本でも読もうかな", 1, 1, 1, 0, 0, 103801, 4, 1354);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もっとたくさんの本に\n囲まれて生活したいな", 1, 1, 1, 0, 0, 103801, 5, 1355);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("むかしむかしある所に\nシオリと\nあの人が…", 4, 1, 1, 0, 0, 103801, 101, 1356);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この本の主人公、\nあの人に\n似ているかも…\nかっこいいな", 8, 1, 1, 0, 0, 103801, 102, 1357);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1, 1, 2, 0, 0, 103801, 1, 1358);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あ…お姉ちゃんと\n約束があったんだ…", 1, 1, 2, 0, 0, 103801, 2, 1359);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 1, 1, 2, 0, 0, 103801, 3, 1360);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1, 1, 2, 0, 0, 103801, 4, 1361);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("読みたい本も\nあなたと行きたい所も\n増えるばっかりです", 4, 1, 2, 0, 0, 103801, 101, 1362);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私の病気、\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 8, 1, 2, 0, 0, 103801, 102, 1363);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1, 1, 2, 0, 1, 103801, 1, 1364);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ふぅ…午前中\n動いたので体力が…\nすこし休みますね", 1, 1, 2, 0, 2, 103801, 2, 1365);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("早く寝ないと\n体に良くないですよね\nでも気になっている\n本があって…", 1, 1, 2, 0, 3, 103801, 3, 1366);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("寝てばかりなので、\n髪が乱れてないかな\n…？", 1, 1, 3, 0, 0, 103801, 1, 1367);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("少し休もう\n…やっぱり\nたくさん休もう", 1, 1, 3, 0, 0, 103801, 2, 1368);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("かわいいものが\n枕元にあると\n安心できるんですよ", 1, 1, 3, 0, 0, 103801, 3, 1369);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いい香り…\n病は気からと言うので\n雰囲気も大事ですね", 1, 1, 3, 0, 0, 103801, 4, 1370);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("こうして温まって\nいると、病気も\n治る気がします", 1, 1, 3, 0, 0, 103801, 5, 1371);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("運動…イメージ\nトレーニングだけじゃ\nだめでしょうか…", 1, 1, 3, 0, 0, 103801, 6, 1372);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("少食ですけど\nこれならたくさん\n食べられそうです", 1, 1, 3, 0, 0, 103801, 7, 1373);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("続きが気になって\n読むのを止める\nタイミングが…", 1, 1, 3, 0, 0, 103801, 8, 1374);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("しっかり休まないと\n早く回復するように", 1, 1, 1, 0, 0, 103802, 1, 1376);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("き、きらーん☆\nお姉ちゃんに\n似てるかな…？　", 1, 1, 1, 0, 0, 103802, 2, 1377);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("病室よりも…\nずっとこの部屋に\nいたいですね…　", 1, 1, 1, 0, 0, 103802, 3, 1378);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("そろそろ好きな\n作家さんの新刊が\n出るから楽しみ…", 1, 1, 1, 0, 0, 103802, 4, 1379);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("大切な人に\n本をすすめるのって\nけっこう難しいなぁ", 1, 1, 1, 0, 0, 103802, 5, 1380);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("むかしむかしある所に\nシオリと\nあの人が…", 8, 1, 1, 0, 0, 103802, 101, 1381);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あの人の\nためにも早く\n病気を治さないと…", 8, 1, 1, 0, 0, 103802, 102, 1382);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ケホケホ…\nコンコン…\nゴホッゴホッ…\nへ、平気ですよ？", 1, 1, 2, 0, 0, 103802, 1, 1383);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("新記録です！\n一週間連続、\n平熱を保ちました！", 1, 1, 2, 0, 0, 103802, 2, 1384);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あ…お薬の時間…\n苦いけど我慢しなきゃ　", 1, 1, 2, 0, 0, 103802, 3, 1385);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("最近調子がいいのは\n牧場の牛乳やチーズの\nおかげでしょうか？", 1, 1, 2, 0, 0, 103802, 4, 1386);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("しおりを探している？\nあ、本に挟む方ですね\nドキドキしました…", 8, 1, 2, 0, 0, 103802, 101, 1387);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私の病気\n悪化してるのかも！？\nすごく胸がドキドキ\nするんです…", 8, 1, 2, 0, 0, 103802, 102, 1388);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("えっと、朝食の前には\nこの薬を飲んで…\n食後にはこの薬を…", 1, 1, 2, 0, 1, 103802, 1, 1389);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("…お昼の薬？\nあ、飲み忘れてました\nありがとうございます", 1, 1, 2, 0, 2, 103802, 2, 1390);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この薬を飲むと\n眠くなっちゃうんです\nでもまだ、あなたと\nお話したいし～", 1, 1, 2, 0, 3, 103802, 3, 1391);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("寝てばかりなので、\n髪が乱れてないかな\n…？　", 1, 1, 3, 0, 0, 103802, 1, 1392);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("少し休もう\n…やっぱり\nたくさん休もう", 1, 1, 3, 0, 0, 103802, 2, 1393);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この子がいれば\n病室に一人でも\n寂しくないですね", 1, 1, 3, 0, 0, 103802, 3, 1394);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いろんな効能が？\n健康になる香りも\nあるのでしょうか？", 1, 1, 3, 0, 0, 103802, 4, 1395);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("こうして温まって\nいると、病気も\n治る気がします", 1, 1, 3, 0, 0, 103802, 5, 1396);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私も、少しは\n体力をつけないと\nいけませんよね　", 1, 1, 3, 0, 0, 103802, 6, 1397);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いっぱい食べて\n健康な体にならないと", 1, 1, 3, 0, 0, 103802, 7, 1398);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("続きが気になって\n読むのを止める\nタイミングが…", 1, 1, 3, 0, 0, 103802, 8, 1399);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("友達ができたら、\n山の上でお弁当…\n夢が広がります…", 1, 1, 1, 0, 0, 104001, 1, 1401);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あ、忘れずに\nお花に水を\nあげなきゃ…", 1, 1, 1, 0, 0, 104001, 2, 1402);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お菓子を作って、\nみなさんに振る舞って\n友達作戦！　とか…", 1, 1, 1, 0, 0, 104001, 3, 1403);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("そろそろ新しい\n草人形を作って\n友達作りの特訓を…", 1, 1, 1, 0, 0, 104001, 4, 1404);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("植物のお世話って、\nぼっちにとっては、\n救い…なんです…", 1, 1, 1, 0, 0, 104001, 5, 1405);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ＢＢ団の活動日…\nまだかな…\nうふふふっ", 4, 1, 1, 0, 0, 104001, 101, 1406);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 8, 1, 1, 0, 0, 104001, 102, 1407);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あ、こんにちは！\n今日もＢＢ団で\nお世話になります！", 1, 1, 2, 0, 0, 104001, 1, 1408);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あの…私の友達作りの\n練習方法、間違って\nませんよね…？", 1, 1, 2, 0, 0, 104001, 2, 1409);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("そうだ、今度、\n森に一緒に木の苗を\n植えに行きませんか？", 1, 1, 2, 0, 0, 104001, 3, 1410);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("人とお話するのって、\n私、大好きです！\n友達ふやすぞ～！", 1, 1, 2, 0, 0, 104001, 4, 1411);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あなたと話してると、\nまるで私がぼっちじゃ\nないみたいです！", 4, 1, 2, 0, 0, 104001, 101, 1412);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 8, 1, 2, 0, 0, 104001, 102, 1413);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おはようございます！\n今日もＢＢ団、\nがんばるぞー！", 1, 1, 2, 0, 1, 104001, 1, 1414);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("なんだか、お腹が\n空いてきました。\nお昼ごはんー♪", 1, 1, 2, 0, 2, 104001, 2, 1415);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もう眠いかもです…\n明日は友達、\nできるといいなあ…", 1, 1, 2, 0, 3, 104001, 3, 1416);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私がもっと\n可愛ければ、\n友達できるかなあ？", 1, 1, 3, 0, 0, 104001, 1, 1417);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ふわあ…のんびり\nしすぎないように\n気を付けなきゃです", 1, 1, 3, 0, 0, 104001, 2, 1418);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("かわいいなあ。\nこの子とも\n友達になりたい…", 1, 1, 3, 0, 0, 104001, 3, 1419);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いい香りです…\n精神統一して\n友達のイメトレ…", 1, 1, 3, 0, 0, 104001, 4, 1420);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("灯りを見てると、\n心がなごみます～", 1, 1, 3, 0, 0, 104001, 5, 1421);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1, 1, 3, 0, 0, 104001, 6, 1422);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おいしいです…\n私に友達がいたら、\n分けてあげたいな", 1, 1, 3, 0, 0, 104001, 7, 1423);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("友達作りの\n参考になりそうなこと\n書いてないかな～？", 1, 1, 3, 0, 0, 104001, 8, 1424);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("友達作りは、焦らず\n慌てず、じっくりと…", 1, 1, 1, 0, 0, 104002, 1, 1426);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ひとつ屋根の下\nって感じ…\nいいですねえ…", 1, 1, 1, 0, 0, 104002, 2, 1427);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("煮汁、煮汁が\n噴きこぼれて\nいませんか～", 1, 1, 1, 0, 0, 104002, 3, 1428);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("今度、みなさんと\nピクニックとか…\nいってみたいな", 1, 1, 1, 0, 0, 104002, 4, 1429);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ぼっちでもいい\nたくましく育てば\n…なんて", 1, 1, 1, 0, 0, 104002, 5, 1430);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("最近、毎日あの人の\nこと考えちゃいます\nどうしてだろう…", 8, 1, 1, 0, 0, 104002, 101, 1431);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もっともっとあの人の\nそばで、一緒に友達を\n作っていきたいな…", 8, 1, 1, 0, 0, 104002, 102, 1432);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あ！　ＢＢ団の活動\nですか？　嬉しくて\n飛び跳ねちゃいます！", 1, 1, 2, 0, 0, 104002, 1, 1433);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あなたとのお話で友達\n作りの練習になるなら\n一石二鳥です！", 1, 1, 2, 0, 0, 104002, 2, 1434);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私少しは人と話しても\nテンパらなくなって\nきましたかね…？", 1, 1, 2, 0, 0, 104002, 3, 1435);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あの、友達作りの\n新しい作戦\n考えてみたんですっ！", 1, 1, 2, 0, 0, 104002, 4, 1436);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あなたとお話する時の\nこの気持ち、私の宝物\nなんです…えへへ", 8, 1, 2, 0, 0, 104002, 101, 1437);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("友達もほしいけど…\nあなたに会えたことが\n私の一番の幸せです", 8, 1, 2, 0, 0, 104002, 102, 1438);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("朝ですね！\nこんないい朝は\n友達作りのチャンス！", 1, 1, 2, 0, 1, 104002, 1, 1439);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あの…そろそろお腹\nすきませんか？\nお昼ごはんは…", 1, 1, 2, 0, 2, 104002, 2, 1440);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もう眠いかもです…\n明日は友達\nできるといいなあ…", 1, 1, 2, 0, 3, 104002, 3, 1441);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私…見た目\nそこまで変じゃ\nないですよね…？", 1, 1, 3, 0, 0, 104002, 1, 1442);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ほわあ～…\nふかふかって\nいいものですね～", 1, 1, 3, 0, 0, 104002, 2, 1443);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この子みたいな\nあいくるしさを\n目指したいです！", 1, 1, 3, 0, 0, 104002, 3, 1444);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("灯りを見てると\n心がなごみます～", 1, 1, 3, 0, 0, 104002, 4, 1445);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ぬくぬくで、なんだか\n眠くなっちゃいますね", 1, 1, 3, 0, 0, 104002, 5, 1446);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("身体を鍛えて\nみなさんを\n守ります！", 1, 1, 3, 0, 0, 104002, 6, 1447);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もぐもぐ…\nおいしいです…！\nみなさんもぜひ！", 1, 1, 3, 0, 0, 104002, 7, 1448);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("友達作りの\n参考になりそうなこと\n書いてないかな～？", 1, 1, 3, 0, 0, 104002, 8, 1449);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("唱喚の歌は、みだりに\n歌っていいものでは\nないんです", 1, 1, 1, 0, 0, 104201, 1, 1451);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ここでアイドルの\n練習は、さすがに\n迷惑ですよね？", 1, 1, 1, 0, 0, 104201, 2, 1452);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1, 1, 1, 0, 0, 104201, 3, 1453);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("人々の平和を守る旅に\n同行してくれる人を\n探していて…", 1, 1, 1, 0, 0, 104201, 4, 1454);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あとで曲を復習して\nおかないと…", 1, 1, 1, 0, 0, 104201, 5, 1455);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("踊りを見られるのは\nまだ恥ずかしいけど\nあの人になら…", 4, 1, 1, 0, 0, 104201, 101, 1456);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 8, 1, 1, 0, 0, 104201, 102, 1457);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1, 1, 2, 0, 0, 104201, 1, 1458);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("え、もう練習の時間？\nごめんなさい\nすぐ準備します！", 1, 1, 2, 0, 0, 104201, 2, 1459);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1, 1, 2, 0, 0, 104201, 3, 1460);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1, 1, 2, 0, 0, 104201, 4, 1461);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 4, 1, 2, 0, 0, 104201, 101, 1462);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 8, 1, 2, 0, 0, 104201, 102, 1463);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("おはようございます♪\n少し歌の練習を\nしてきますね", 1, 1, 2, 0, 1, 104201, 1, 1464);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もうお昼なんですか？\n練習に夢中で\n気づきませんでした", 1, 1, 2, 0, 2, 104201, 2, 1465);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("明日の予定は…\nアイドルはやることが\n多いみたいで…", 1, 1, 2, 0, 3, 104201, 3, 1466);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1, 1, 3, 0, 0, 104201, 1, 1467);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("歌の調子をよくする\nためには休息も\n必要ですよね…", 1, 1, 3, 0, 0, 104201, 2, 1468);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("この子たちを\n相手に練習して\nみようかな…♪", 1, 1, 3, 0, 0, 104201, 3, 1469);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1, 1, 3, 0, 0, 104201, 4, 1470);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ここにいると\n穏やかな旋律が\n浮かんできます…", 1, 1, 3, 0, 0, 104201, 5, 1471);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("歌うためには\n体力づくりは\n欠かせません", 1, 1, 3, 0, 0, 104201, 6, 1472);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("歌った後は\nお腹が空いて\nしまうんです", 1, 1, 3, 0, 0, 104201, 7, 1473);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("音楽について\n理論も勉強\nしないと…", 1, 1, 3, 0, 0, 104201, 8, 1474);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("歌うことの楽しさ\n分かってきました\nもっと歌いたいな…", 1, 1, 1, 0, 0, 104202, 1, 1476);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("練習してもあんまり\n疲れなくなった…\nアイドルのおかげかな", 1, 1, 1, 0, 0, 104202, 2, 1477);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("精霊も強くなったし\nもっとたくさんの人を\n守りたいです", 1, 1, 1, 0, 0, 104202, 3, 1478);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("最近、よく頭の中に\n歌が浮かんできます\n不思議な感覚…", 1, 1, 1, 0, 0, 104202, 4, 1479);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("楽譜を買いました\n思いついた歌を\n書き留めておくために", 1, 1, 1, 0, 0, 104202, 5, 1480);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("浜辺で曲を書こうと\n思うんですけど…\n一緒に行きませんか？", 8, 1, 1, 0, 0, 104202, 101, 1481);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("私の中にある\n私だけの歌…\n作ってみようかな？", 8, 1, 1, 0, 0, 104202, 102, 1482);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("守るべき人たちに\n笑顔でいてもらうのも\n大切なんですね", 1, 1, 2, 0, 0, 104202, 1, 1483);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("歌える曲を増やそうと\n思って。どんな曲が\n聞きたいですか？", 1, 1, 2, 0, 0, 104202, 2, 1484);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("魔物退治ですか！？\n…違います？\n良かった…", 1, 1, 2, 0, 0, 104202, 3, 1485);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いつも応援ありがとう\nございます♪　これは\nあ、握手の練習です！", 1, 1, 2, 0, 0, 104202, 4, 1486);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("…歌って欲しい？\n喜んで♪\nどの歌にしましょう？", 8, 1, 2, 0, 0, 104202, 101, 1487);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("～～♪　あれ？\n今私、歌ってました？\n気づきませんでした", 8, 1, 2, 0, 0, 104202, 102, 1488);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("呼吸を深く、大きく…\nこれでちゃんと\n目が覚めますよ", 1, 1, 2, 0, 1, 104202, 1, 1489);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("少し休んだら\n午後の練習に\n行ってきますね", 1, 1, 2, 0, 2, 104202, 2, 1490);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("曲を作っていたら\nもうこんな時間…\nおやすみなさい", 1, 1, 2, 0, 3, 104202, 3, 1491);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("見た目については\n前よりも気をつけてと\nノゾミに言われてます", 1, 1, 3, 0, 0, 104202, 1, 1492);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あ～…♪\nよく体がほぐれます…\nいい歌が歌えそうです", 1, 1, 3, 0, 0, 104202, 2, 1493);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("かわいいと思う\n気持ちを、歌にしても\nいいかも知れませんね", 1, 1, 3, 0, 0, 104202, 3, 1494);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("…疲れてるのかな\n落ち着けているのが\n自分でもわかります", 1, 1, 3, 0, 0, 104202, 4, 1495);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ここにいると\n穏やかな旋律が\n浮かんできます…", 1, 1, 3, 0, 0, 104202, 5, 1496);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("もっと体力をつけて\n最高のライブを\nファンに届けます！", 1, 1, 3, 0, 0, 104202, 6, 1497);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("これでも一応\n体形には気をつけて\n食べてるんですよ？", 1, 1, 3, 0, 0, 104202, 7, 1498);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("読書は歌に\n新しい風を\n吹き込んでくれます", 1, 1, 3, 0, 0, 104202, 8, 1499);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("店の新メニューでも\n考えるかな", 1, 1, 1, 0, 0, 104301, 1, 1501);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あたしの店から、\n出前を届けようか？", 1, 1, 1, 0, 0, 104301, 2, 1502);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("パトロール、\nパトロール…\nここは異常なしかな？", 1, 1, 1, 0, 0, 104301, 3, 1503);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("腹へったら食う！\n悩んだら寝る！\nそれが一番だろ？", 1, 1, 1, 0, 0, 104301, 4, 1504);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("のんびりし過ぎるのも\n…性に合わねぇな", 1, 1, 1, 0, 0, 104301, 5, 1505);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("そろそろあいつ、\n腹すかしてるん\nじゃないかな？", 4, 1, 1, 0, 0, 104301, 101, 1506);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("今日の献立は…\nあいつの好きなものに\nしてやるか", 8, 1, 1, 0, 0, 104301, 102, 1507);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("強くなりたいなら、\nあたしがビシバシ\n鍛えてやるよ", 1, 1, 2, 0, 0, 104301, 1, 1508);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("天気がいい日は\n外で運動したく\nならねぇか？", 1, 1, 2, 0, 0, 104301, 2, 1509);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("腹減ったか？　なんか\n作ってやろうか？", 1, 1, 2, 0, 0, 104301, 3, 1510);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ん？　なんだよ、\n相談事か？\nなんでも言ってくれ", 1, 1, 2, 0, 0, 104301, 4, 1511);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お前が好きな飯って\nなんだ？\n今度、作ってやるよ", 4, 1, 2, 0, 0, 104301, 101, 1512);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("お前って不思議だよな\n一緒にいるとなんだか\n…なんでもねーよ", 8, 1, 2, 0, 0, 104301, 102, 1513);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("気持ちいい朝だな！\n体を動かしたい気分だ\n付き合ってくれるか", 1, 1, 2, 0, 1, 104301, 1, 1514);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("昼飯もう食ったか？\nまだなら、あたしが\nなんか作ってやるよ", 1, 1, 2, 0, 2, 104301, 2, 1515);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("日中たっぷり動いたら\nそのぶん夜はしっかり\n休んどけよな", 1, 1, 2, 0, 3, 104301, 3, 1516);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("た、たまにはその…\nかわいい格好とか\nしても…", 1, 1, 3, 0, 0, 104301, 1, 1517);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ふわぁ、\n一休みすっかなぁ～", 1, 1, 3, 0, 0, 104301, 2, 1518);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("うっ！　か、かわいい\nじゃねぇか", 1, 1, 3, 0, 0, 104301, 3, 1519);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("へー　いい匂いだな\nあいつもこういうの\n好きなのかな…", 1, 1, 3, 0, 0, 104301, 4, 1520);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("ふわぁ〜！\n温かいと、つい\nウトウトしちまうな", 1, 1, 3, 0, 0, 104301, 5, 1521);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("オラオラオラーーー！\n燃えるぜーーー！", 1, 1, 3, 0, 0, 104301, 6, 1522);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("いい味してるぜ！\nうちの店でも\n出してみたいな", 1, 1, 3, 0, 0, 104301, 7, 1523);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("文字を読んでると\nどうしても眠く\nなっちまうんだよなぁ", 1, 1, 3, 0, 0, 104301, 8, 1524);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("パトロール終了～\n本日も異常なしっと！", 1, 1, 1, 0, 0, 104302, 1, 1526);
INSERT INTO `v1_020bd759390adf334c8839c050d449f884f97e100e3725b5c0ab996aba8f10ce` VALUES ("あたしの店から\n出前を届けようか？", 1, 1, 1, 0, 0, 104302, 2, 1527);
